import Table from "@mui/material/Table";
import axios from "axios";
import TableHead from "@mui/material/TableHead";
import TableBody from "@mui/material/TableBody";
import TableRow from "@mui/material/TableRow";
import TableCell from "@mui/material/TableCell";
import { useLocation, useNavigate } from "react-router-dom";
import {useState,useEffect} from "react";
/*import { useEffect,useState } from "react"*/

const Complete = ({user ,setUser}) => {
  const navigate = useNavigate();
  const location=useLocation();
  const [item, setItems] = useState({id:'',itemName:'',price:''});

  useEffect(() => {
    axios.get("http://localhost:8080/items").then((res) => {
      setItems(res.data.find(data=>data.id===location.state.id)); 

    });
  }, []);


  return (
    <div className="App">신청되셨습니다. 곧 연락 드리겠습니다.
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>유저</TableCell>
            <TableCell>신청 서비스 </TableCell>
            <TableCell>가격 </TableCell>
            <TableCell>남은 크레딧</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
         <TableRow>
            <TableCell>{user.username}</TableCell>
            <TableCell>{item.itemName} </TableCell>
            <TableCell>{item.price}</TableCell>
              <TableCell>{user.credit-item.price}</TableCell>
            <TableCell></TableCell>
            <TableCell></TableCell>
          </TableRow>
        </TableBody>
      </Table>

</div>
  )
}


export default Complete
